function filter(e,o,t,l){let n=document.querySelector("#"+e).value;n.length>0?document.querySelector("#"+o).classList.remove("hidden"):document.querySelector("#"+o).classList.add("hidden");let c=document.querySelector(t).querySelectorAll(l);for(let e=0;e<c.length;e++)c[e].textContent.toLowerCase().includes(n.toLowerCase())||c[e].outerText.toLowerCase().includes(n.toLowerCase())?showBlock(c[e]):hideBlock(c[e])}function showBlock(e){e.classList.remove("hidden")}function hideBlock(e){e.classList.add("hidden")}function clearFilter(e,o,t,l){document.querySelector("#"+e).value=null,filter(e,o,t,l),document.querySelector("#"+e).select()}function toggleTr(e,o){$(o).hasClass("fa-chevron-down")?($(o).removeClass("fa-chevron-down"),$(o).addClass("fa-chevron-up")):($(o).removeClass("fa-chevron-up"),$(o).addClass("fa-chevron-down")),$(e).slideToggle();try{$("html, body").animate({scrollTop:$(o).offset().top-150},500)}catch(e){}}function hideElement(e){showLoader(),$(e).hide()}function showLoader(){$("#loader").show()}